CREATE FUNCTION get_past_user_attendance(in_user_id integer, in_limit integer, in_offset integer, OUT location_id integer, OUT attendance_date date, OUT attendance_status text) RETURNS SETOF record
    LANGUAGE sql
    AS $_$
    SELECT location_id, attendance_date, attendance_status
      FROM location_attendees
        JOIN attendance_statuses USING ( attendance_status_id )
      WHERE user_id = $1
            AND attendance_status_id IN ( 1, 3 )
            AND attendance_date < CURRENT_DATE
      ORDER BY attendance_date DESC, set_at DESC LIMIT $2 OFFSET $3;
  $_$;


