--
-- Name: reset_password(text, text); Type: FUNCTION; Schema: public; Owner: mayosala_socialer
--

CREATE FUNCTION reset_password(in_code text, in_password text) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
    DECLARE
      req integer;
    BEGIN
      req := (
SELECT user_id 
FROM password_reset_requests 
WHERE hashcode = $1 AND used = false AND AGE(requested_at) < INTERVAL '1 DAY' );
      IF req is not null THEN
        PERFORM update_user_password( req, $2 );
        UPDATE password_reset_requests SET used = true WHERE user_id = req;
        RETURN TRUE;
      ELSE
        RETURN FALSE;
      END IF;
    END;
  $_$;


ALTER FUNCTION public.reset_password(in_code text, in_password text) OWNER TO mayosala_socialer;

