CREATE FUNCTION user_tag_delete(in_user_id integer, in_tag_desc text) RETURNS void
    LANGUAGE plpgsql
    AS $_$
    BEGIN
      DELETE FROM user_tag_prefs u WHERE u.user_id = $1 AND u.tag_id = get_tag_id( $2 );
    END;
  $_$;


