56	Dubbed Philly's most worldy DJ, DJ Rahsaan is the Rosetta Stone of global grooviness. As a thrill seeking DJ he ha made people laugh, love and dance to infectious grooves in multiple languages. Come enjoy the beautiful newly opened Barnes Foundation with some great beats in the backdrop. 	2012-07-06 04:00:00+00	2012-07-07 03:59:00+00	<div class="FeaturedEventInfo"><img class="FeaturedEventImage" src="/Photos/Featured/philadelphia-celebrates-the-opening-of-the-barnes-foundation-s-new-campus-galleries-and-garden-on-the-parkway.562.325.jpeg" /><div class="FeaturedEventBottomBar"><h1 class="FeaturedEventHeadline">First Friday! World Music by DJ Rahsaan</h1><div class='FeaturedEventLocation'>The Barnes Foundation</div><div class="FeaturedEventTime"> 6-8pm</div></div></div>	300 North Latchs Lane, Merion Station, PA	\N	\N	\N	\N
