60	194	261	2012-07-03 14:06:15.555739+00	2012-07-19 03:14:54.752976+00	Hey thanks man... So as youll probably see next time you log in, we changed "like" on the trending to "going". It seemed that it was confusing to people to differentiate between places people liked and events going on for a specific day. Right now the home page is sort of a venue discovery type of place where you can search for different places and they are filtered by how many "likes" and by which category you search. On your profile it will show the places you have "liked", not where you have actually decide to attend. We are making the change in wording today.\n\nThere is definitely going to be an option to post your own events in the future. We have talked about a "community" tab where peope can basically post events and share them with others. \n\nIt seems that the interaction was pretty confusing for a number of people. We are working to figure out why, and are actively trying to improve the site in that regard. If you have any insight as to what is confusing for you, please let me know. Hope this was helpful and thanks for the feedback.\n\nRay
